import React from 'react';
import Chips from '../Chips/Chips';

const Style = {
    picture: {
        width: 400
    },
    diplayChips: {
        position: 'relative'
    }
}

function Project(props) {
    return (
        <div className="myproject">
            <span style={Style.displayChips} ><img src={props.imgUrl} alt="" style={Style.picture}/></span>
            <Chips />
        </div>
    );
}

export default Project
